import logo from './logo.svg';
import './App.css';
import Home from './Home';
import About from './About'

import { BrowserRouter as Router,Route,Routes } from 'react-router-dom';

function App() {
  return (
    <>
      This is my App component
      <Router>
        <Routes>

          <Route exact path = "/">
            <Home />
          </Route>

          <Route exact path = '/about'>
            <About />
          </Route>
          </Routes>
      </Router>
    </>
  );
}

export default App;
